Recipe: Wife’s cuisine 
Rebake : @deasylo 

Bahan luarnya: 
200 gr tepung tapioka 
40 gr tepung ketan putih
35 gr tepung komachi 
1 butir telor 
4 gr garam 
20 gr corn syrup ( madu) 
100 ml susu cair uht 
40 gr minyak makan ( minyak sayur ) 
60 gr butter ( golden churn) 

Caranya : 
1. Campurkan bahan kering dan aduk rata dan di mangkok kecil aduk dulu telor susu minyak +madu dan tuang ke bahan kering dan aduk rata terakhir masukan butter .
2. Setelah itu bungkus plastik wrap dan masukan ke kulkas 30 menit . 

Bahan crumbs: 
Tepung ubi ungu secukupnya aja buat balurin bagian luar biar menjadi warna ungu . ( beli di toped / shopee) 

Bahan filling: 
400 gr ubi warna orange ( kukus dan di hancur kan dengan garpu) 
2 sdm susu uht
1 sdm mayonnaise 
2 sdm butter 
1 sdm madu ( sy skip ) 
Sejumput garam 
Keju ( saya skip ) 

Caranya : 
Semua bahan di campur aduk sampai rata dan di bagi menjadi 7 bagian @62 gr

Cara membentuk : 
1. Ambil bagian kulitnya @66gr  lebarin dan bungkus bagian filling . 
2. Lakukan sampai habis 
3. Kemudian balurkan ke tepung ubi ungu ( beli di shopee / toped ya) 
4. Taruh di atas loyang yang udh di alasim kertas baking dan tusuk sedikit dengan sumpit dan bentukim garis menyerupai ubi asli . 
5. Setelah itu panaskan oven 180 c api atas bawah selama 10-15 menit 
6. Panggang dengan suhu yang sama 180 c api atas bawah selama 15-20 menit . 
7. Setelah matang angkat dan siap di santap 💜💜💜

